import React from 'react';
import planeImage from '/Users/mehreenaiman/Documents/GitHub/FlightForesight/API Model Deployment/flight-foresight/src/images/kisspng-airplane-mode-computer-icons-plane-5acdf256b24965.6757273115234463587303.png';

const BackgroundTravelWebsite = () => {
    return (
        <div>
            {/* Injecting global styles using a <style> tag */}
            <style>
                {`
                    body {
                        background-color: #87CEEB; /* Sky blue */
                        font-family: Arial, sans-serif;
                        margin: 0;
                        padding: 0;
                        color: #333;
                    }
                `}
            </style>

            <div style={{
                textAlign: 'left',
                paddingLeft: '20px',
                display: 'flex',
                alignItems: 'center',
            }}>
                <img 
                    src={planeImage} 
                    alt="JetSet" 
                    style={{
                        width: '40px', 
                        height: 'auto', 
                        paddingTop: '30px', 
                        transform: 'rotate(270deg)',
                        marginRight: '20px',
                    }} 
                />
                <h1 style={{ color: '#000000', fontSize: '40px' }}>jetSet</h1>       
            </div>
        </div>
    );
};

export default BackgroundTravelWebsite;
